import angular from 'angular'
//import router from '../main'
location.reload()
let app = angular.module('FrontOffice', [])

app.controller('frontCtrl', function($scope) {
    $scope.dashboard = true
    $scope.goToCommerce = function(){
        console.log('commerce')
    }

    $scope.enterPage = function(){
        console.log('ciao')
        $scope.dashboard = false
    }

    
})
export default{
    template: require('../views/FrontOffice.html')
}
